Script.HardcodedValue:
param( [Parameter(Mandatory=$true)] [ValidatePattern("\b(?:\d{1,3}\.){3}\d{1,3}\b")] [String]$NetworkAddress, [Parameter(Mandatory=$true)] [ValidateRange(8,32)] [Int]$ParentSubnetMaskBits, [ValidateRange(8,32)] [Int]$ChildSubnetMaskBits, [Parameter(Mandatory=$true)] [String]$VLANInstance, [Parameter(Mandatory=$true)] [String]$TenantName, [Parameter(Mandatory=$true)] [ValidateSet("Public","Private")] [String]$AddressType, [Parameter(Mandatory=$false)] [Int]$SkipReservedIpCount = 0, [Parameter(Mandatory=$false)] [String]$NetworkPODSIName = [String]::Empty, [Parameter(Mandatory=$false)] [String]$NetworkPODName = [String]::Empty )
Function Get-NextIpAddress{ param( [Parameter(Mandatory=$true)] [ValidatePattern("\b(?:\d{1,3}\.){3}\d{1,3}\b")] [String]$Address )
$a = [System.Net.IpAddress]::Parse($address) $z = $a.GetAddressBytes() if ($z[3] -eq 255){ $z[3] = 0 if ($z[2] -eq 255){ $z[2] = 0 $z[1] += 1 } else{ $z[2] += 1 } } else{ $z[3] += 1 } $c = [System.Net.IPAddress]($z) return $c.ToString() }
Function Get-SubnetDetails{ param ( [Parameter(Mandatory=$true)] [ValidatePattern("\b(?:\d{1,3}\.){3}\d{1,3}\b")] [String]$SubnetAddress, [Parameter(Mandatory=$true)] [ValidateRange(8,32)] [Int]$SubnetMask, [Parameter(Mandatory=$false)] [Int]$SkipReservedCount = 0 )
if ($SubnetMask -lt 31){ $bits = @(0,128,192,224,240,248,252,254) $octets = $SubnetAddress.Split(".") $activ = $SubnetMask % 8 $actval = $bits[$activ] $fulloctets = [System.Math]::Truncate($SubnetMask / 8)
$ao = [int]$octets[$fulloctets] $mn = 256 $actval $x = [System.Math]::Truncate($ao / $mn) $num = $x * $mn
$bd = $num + $mn -1 switch ($fulloctets){ 1 { $fixed = $octets[0] $subnet = $fixed + "." + $num.ToString() + ".0.0" $strmask = "255." + $actval.ToString() + ".0.0" $BroadcastAddress = $fixed + "." + $bd.ToString() + ".255.255" break } 2 { $fixed = $octets[0] + "." + $octets[1] $subnet = $fixed + "." + $num.ToString() + ".0" $strmask = "255.255." + $actval.ToString() + ".0" $BroadcastAddress = $fixed + "." + $bd.ToString() + ".255" break } 3 { $fixed = $octets[0] + "." + $octets[1] + "." + $octets[2] $subnet = $fixed + "." + $num.ToString() $strmask = "255.255.255." + $actval.ToString() $BroadcastAddress = $fixed + "." + $bd.ToString() break } }
#Get Gateway Address $SubnetAddressoct = $subnet.Split(".") $SubnetAddressoct[3] = ([int]$SubnetAddressoct[3] + 1).ToString() $gip = $SubnetAddressoct[0]+"."+$SubnetAddressoct[1]+"."+$SubnetAddressoct[2]+"."+$SubnetAddressoct[3]
#Get First and Last Usable IP $bdoct = $BroadcastAddress.Split(".") $bdoct[3] = ([int]$bdoct[3] - 1).ToString() $lip = $bdoct[0] + "." + $bdoct[1] + "." + $bdoct[2] + "." + $bdoct[3] $fip = Get-NextIpAddress -Address $gip } elseif ($SubnetMask -eq 31){ $strmask = "255.255.255.254" $subnet = $SubnetAddress $BroadcastAddress = (Get-NextIpAddress -Address $SubnetAddress) $lip = $BroadcastAddress $fip = $SubnetAddress $gip = $SubnetAddress } elseif ($SubnetMask -eq 32) { $strmask = "255.255.255.255" $subnet = $SubnetAddress $BroadcastAddress = $SubnetAddress $lip = $SubnetAddress $fip = $SubnetAddress $gip = $SubnetAddress }
$o = New-Object PSObject -Property @{ SubnetAddress=$SubnetAddress SubnetMask=$strmask GatewayAddress=$gip FirstUsableIP=$fip LastUsableIP=$lip BroadcastAddress=$BroadcastAddress SubnetBits=$SubnetMask Status="Unallocated" VLANInstance=[String]::Empty Tenant=[String]::Empty ReservedAddresses=[String]::Empty AddressType=$AddressType }
#Reserve additional IPs if ($SkipReservedCount -gt 0){ $ReservedAddressList=@() 0..$SkipReservedCount |foreach{ $ReservedAddressList += $o.FirstUsableIP $o.FirstUsableIP = Get-NextIpAddress -Address $o.FirstUsableIP } $o.ReservedAddresses = ($ReservedAddressList -join ",") } return $o }
Function Get-SubnetChunk{ param ( [Parameter(Mandatory=$true)] [ValidatePattern("\b(?:\d{1,3}\.){3}\d{1,3}\b")] [String]$ParentSubnet, [Parameter(Mandatory=$true)] [ValidateRange(8,31)] [Int]$ParentChunkSize, [Parameter(Mandatory=$true)] [ValidateRange(8,32)] [Int]$ChunkSize )
$diff = $ChunkSize - $ParentChunkSize $subs = @() $sub1 = $null 1..$diff | foreach { $currMask = $ParentChunkSize + $_ $sub1 = Get-SubnetDetails -SubnetAddress $ParentSubnet -SubnetMask $currMask $sub2 = Get-SubnetDetails -SubnetAddress (Get-NextIpAddress -Address $sub1.BroadcastAddress) -SubnetMask $currMask -SkipReservedCount 0 $sub2.Status = "Unassigned" $sub2.FirstUsableIP = [String]::Empty if ($AddressType -eq "Private") { $sub2.Tenant = $TenantName } else { $sub2.Tenant = "Shared" } $subs += $sub2 } $sub1.Status = "Assigned" $sub1.VLANInstance = $VLANInstance $sub1.Tenant = $TenantName $subs += $sub1 return $subs }
$subs = Get-SubnetChunk -ParentSubnet $NetworkAddress -ParentChunkSize $ParentSubnetMaskBits -ChunkSize $ChildSubnetMaskBits [Xml]$x = "<table />" foreach ($s in $subs){ $row = $x.DocumentElement.AppendChild($x.CreateElement("row")) $row.AppendChild($x.CreateElement("Name")).InnerText = [Guid]::NewGuid().ToString() $row.AppendChild($x.CreateElement("Status")).InnerText = $s.Status $row.AppendChild($x.CreateElement("SubnetAddress")).InnerText = $s.SubnetAddress $row.AppendChild($x.CreateElement("SubnetMask")).InnerText = $s.SubnetMask $row.AppendChild($x.CreateElement("SubnetBits")).InnerText = $s.SubnetBits $row.AppendChild($x.CreateElement("GatewayAddress")).InnerText = $s.GatewayAddress $row.AppendChild($x.CreateElement("FirstUsableIP")).InnerText = $s.FirstUsableIP $row.AppendChild($x.CreateElement("LastUsableIP")).InnerText = $s.LastUsableIP $row.AppendChild($x.CreateElement("BroadcastAddress")).InnerText = $s.BroadcastAddress $row.AppendChild($x.CreateElement("VLANInstance")).InnerText = $s.VLANInstance $row.AppendChild($x.CreateElement("Tenant")).InnerText = $s.Tenant $row.AppendChild($x.CreateElement("ReservedAddresses")).InnerText = $s.ReservedAddresses $row.AppendChild($x.CreateElement("AddressType")).InnerText = $s.AddressType $row.AppendChild($x.CreateElement("NetworkPODSIName")).InnerText = $NetworkPODSIName $row.AppendChild($x.CreateElement("NetworkPODName")).InnerText = $NetworkPODName }
$x.OuterXml
